const KNOWN_SPAM_COMBOS = [
    ['waffle house ', 'found ', 'new host']
]

function _comboHelper(text, items) {

    for (let item of items) {

        if (item instanceof RegExp) {
            if (!text.match(item)) return false;

        } else { // is a string

            let matches = item.startsWith('~') ?
                !text.includes(item.slice(1))
                : text.includes(item);
            if (!matches) return false;

        }

    }
    return true;
}

function comboDetect(text, combinations) {
    if (Array.isArray(text)) {
        return combinations.some(item => text.every((t, i) => _comboHelper(t, item[i])));
    } else {
        return combinations.some(item => _comboHelper(text, item));
    }
}

function rule_detect(comment) {
    let authorName = comment.data.author_name
    let commentText = comment.data.text

    authorName = replaceWhitespaceWithSpaces(authorName);

    // TODO remove unicode characters

    if (authorName.match(INVALID_USERNAMES))
        return COMMENT_LABEL.SCAM;

    if (authorName.match(INVALID_NOVID_USERNAMES))
        return COMMENT_LABEL.SELF_PROMO;

    if (authorName.match(INVALID_AD_USERNAMES))
        return COMMENT_LABEL.SCAM;

    let normalizedUsername = normalize(authorName);
    if (comboDetect(normalizedUsername, SCAM_AUTHOR_COMBOS))
        return COMMENT_LABEL.SCAM;

    commentText = replaceWhitespaceWithSpaces(commentText);

    if (commentText.match(TEXT_BLACK_WORDS))
        return COMMENT_LABEL.SCAM;

    let normalizedText = normalize(commentText);
    if (normalizedText.match(TEXT_EXACT_BLACK_WORDS))
        return COMMENT_LABEL.SCAM;
    if (comboDetect(normalizedText, SCAM_TEXT_COMBOS))
        return COMMENT_LABEL.SCAM;

    if (comboDetect([normalizedUsername, normalizedText], SCAM_NAME_TEXT_COMBOS))
        return COMMENT_LABEL.SCAM;

    if (comboDetect(normalizedText, KNOWN_SPAM_COMBOS))
        return COMMENT_LABEL.OTHER_SPAM;

    let combined = authorName + ' ' + commentText

    if ((combined.match(ONLY_NUM_REGEX) || []).length >= 6)
        return COMMENT_LABEL.SCAM;

    if (combined.match(PHONE_NUM_REGEX))
        return COMMENT_LABEL.SCAM;

    if (comboDetect(normalizedText, LINK_SPAM_COMBOS))
        return COMMENT_LABEL.LINK_SPAM;
    if (isValidUrl(commentText))
        return COMMENT_LABEL.LINK_ONLY;

    // check if it contains a *clickable* URL
    let link = comment.querySelector('#content-text > a.yt-simple-endpoint');
    if (link && !(link.href.match(TIMESTAMP_REGEX))) {
        return COMMENT_LABEL.LINK_CONTAINS;
    }

    return COMMENT_LABEL.VALID
}
